solution:
Let $P$ be the point on the unit circle that is $225^\circ$ counterclockwise from $(1,0)$, and let $D$ be the foot of the altitude from $P$ to the $x$-axis, as shown below.

[asy]

pair A,C,P,O,D;

draw((0,-1.2)--(0,1.2),p=black+1.2bp,Arrows(0.15cm));

draw((-1.2,0)--(1.2,0),p=black+1.2bp,Arrows(0.15cm));

A = (1,0);

O= (0,0);

label("$x$",(1.2,0),SE);

label("$y$",(0,1.2),NE);

P = rotate(225)*A;

D = foot(P,A,-A);

draw(O--P--D);

draw(rightanglemark(O,D,P,2));

draw(Circle(O,1));

label("$O$",O,NE);

label("$P$",P,SW);

//label("$A$",A,SE);

label("$D$",D,N);

[/asy]

Triangle $POD$ is a 45-45-90 triangle, so $DO = DP = \frac{\sqrt{2}}{2}$.  Therefore, the coordinates of $P$ are $\left(-\frac{\sqrt{2}}{2}, -\frac{\sqrt{2}}{2}\right)$, so $\cos 225^\circ = \boxed{-\frac{\sqrt{2}}{2}}$.

Let's start with a picture: [asy]
import three;
triple d = (0,0,0);
triple b = (1,0,0);
triple c = (1/2,sqrt(3)/2,0);
triple a = (1/2,sqrt(3)/6,sqrt(6)/3);
triple p = (a+b+c+d)/4;
triple q = (d+b+c)/3;
draw(a--b--c--a); draw(c--d--b,dotted); draw(d--a,dotted); draw(a--q,dashed);
dot(a); dot(b); dot(c); dot(d); dot(p); dot(q);
label("$A$",a,N);
label("$B$",b,WSW);
label("$C$",c,ESE);
label("$D$",d,ENE);
label("$P$",p,W);
label("$Q$",q,W);
[/asy] We can carve $ABCD$ into four (non-regular) tetrahedra that share $P$ as a vertex and have respective bases $ABC$, $ABD$, $ACD$, and $BCD$ (the faces of $ABCD$). For example, this diagram shows one of these four tetrahedra, namely $BCDP$: [asy]
import three;
triple d = (0,0,0);
triple b = (1,0,0);
triple c = (1/2,sqrt(3)/2,0);
triple a = (1/2,sqrt(3)/6,sqrt(6)/3);
triple p = (a+b+c+d)/4;
triple q = (d+b+c)/3;
draw(a--b--c--a); draw(c--d--b,dotted); draw(d--a,dotted); draw(a--q,dashed);
draw(surface(b--p--c--cycle),red,nolight);
draw(surface(d--p--c--cycle),red+white,nolight);
dot(a); dot(b); dot(c); dot(d); dot(p);
label("$A$",a,N);
label("$B$",b,WSW);
label("$C$",c,ESE);
label("$D$",d,ENE);
label("$P$",p,W);
[/asy] The four tetrahedra formed in this way are congruent, so each contains one-quarter the volume of $ABCD$.

The height of tetrahedron $BCDP$ is $PQ$, so the volume of $BCDP$ is $$\frac 13\cdot (\text{area of }\triangle BCD)\cdot PQ.$$The volume of the original tetrahedron, $ABCD$, is $$\frac 13\cdot (\text{area of }\triangle BCD)\cdot AQ.$$Thus $PQ/AQ$ is equal to the ratio of the volume of $BCDP$ to the volume of $ABCD$, which we already know to be $\boxed{\frac{1}{4}}$.

