solution:
Because $\triangle PQR$ is isosceles with $PQ=QR$, median $\overline{QM}$ is also an altitude:


[asy]
size(100);
pair P,Q,R,M,NN;
P = (0,0);
Q = (0.5,0.9);
R = (1,0);
NN = (0.5,0);
M = (Q+R)/2;
draw(rightanglemark(Q,NN,P,2.5));
draw(P--Q--R--P);
draw(Q--NN);
label("$P$",P,SW);
label("$R$",R,SE);
label("$Q$",Q,N);
label("$M$",NN,S);
[/asy]

We have $MP = PR/2 = 16$, so right triangle $PQM$ gives us  \begin{align*}
QM &= \sqrt{PQ^2 - PM^2}\\
&= \sqrt{34^2 - 16^2}\\
&= \sqrt{(34-16)(34+16)}\\
& = \boxed{30}.
\end{align*}  (We might also have recognized that $PM/PQ = 8/17$, so $QM/PQ = 15/17$.)

gpt-4_answer:
Let $S$ be the midpoint of $\overline{PR}$, so $QM = MS$. Since $QS = \frac{1}{2}(P + R) = 34$, we have that $\triangle QSM$ is a right triangle with right angle at $M$. By the Pythagorean theorem, we have $QM^2 + MS^2 = QS^2 \Longrightarrow QM^2 + QM^2 = 34^2$. Thus, $2QM^2 = 34^2 \Longrightarrow QM^2 = 17^2$. $QM = \boxed{17}$.

