draw((0,-7)--(0,7),linewidth(1),Arrows);

for(int i=-5; i<0; ++i)
{

draw((i,-.5)--(i,.5),linewidth(1));
}

for(int i=1; i<6; ++i)
{

draw((i,-.5)--(i,.5),linewidth(1));
}

for(int i=-5; i<0; ++i)
{

draw((-.5,i)--(.5,i),linewidth(1));
}

for(int i=-5; i<0; ++i)
{

draw((-.5,-i)--(.5,-i),linewidth(1));
}

label("$x$", (8,0));
label("$y$", (0,8));

