Let $x = AP = PQ = QB = BC.$  Let $\alpha = \angle QAP = \angle PAB$ and $\beta = \angle QPA = \angle QBP.$  Then by the Law of Cosines on triangle $APQ,$
\begin{align*}
PQ^2 &= PA^2 + AQ^2 - 2 \cdot PA \cdot AQ \cos \alpha \\
x^2 &= x^2 + (x + x \cos \alpha)^2 - 2x(x + x \cos \alpha) \cos \alpha.
\end{align*}Expanding, we get
\[x^2 = x^2 + 2x^2 \cos \alpha + x^2 \cos^2 \alpha - 2x^2 \cos \alpha - 2x^2 \cos^2 \alpha.\]This simplifies to
\[\cos^2 \alpha = \frac{1}{2},\]so $\cos \alpha = \frac{1}{\sqrt{2}}.$

