Consider the circle $C$ with center $(-3,2)$ and radius $r.$ As the diagram shows, this circle $C$ is tangent to the two given circles. Let $E,D,$ and $F$ be the tangency points with circle $C$ on lines $x=-3,$ $y=-1$ and $y=2,$ respectively, and let $P=(-3,2).$ As $C$ is tangent to the given circle with center $(0,-1),$ then $PC$ is tangent to the larger given circle. Thus, $PC=7\sqrt{2}.$ Similarly, $PA=2\sqrt{2}$ and $PB=4\sqrt{2}.$ Then, \[\cos(\angle PD = \measuredangle PDE)=\frac{PC^2-PA^2-PB^2}{(2\cdot PC \cdot PD)}=\frac{0}{0}\] which tells us that $\angle PD = \measuredangle PDE = 90^{\circ},$ so $DE\parallel DC.$

As $DE\parallel DC$ and the circles are tangent, we have $DP=PC=7\sqrt{2},$ so the coordinates of $D$ are $(-3,7\sqrt{2}+2) = (-3,15).$ Then, the smaller circle has equation $(x+3)^2+(y-2)^2=4^2.$ Hence, $D+E+F=-3-2-16=-\boxed{21}.$[asy]
