Let $O$ be the center of the circle, and let $A$, $B$, and $C$ be the vertices of the equilateral triangle.  We begin by finding $OC$.  Let $O$ be the origin of a coordinate system in which $OC$ lies on the positive $x$-axis.  Then $C = (3, 0)$, and the midpoint of $\overline{AB}$ is $(0, \sqrt{6^2 - 3^2}) = (0, 3\sqrt{3})$.  Therefore, $OC = 3$, and the center of the circle is at $(3, 0)$.

