Without loss of generality, let the side length of the hexagon be 1 unit. Also let $u$ be the length of each of the equal sides in the removed isosceles triangles.  Define points $A$, $B$, $C$, $D$, $E$, and $F$ as shown in the diagram.  Triangle $CDB$ is a 30-60-90 triangle, so $CD=u/2$ and $DB=u\sqrt{3}/2$.  Also, $AB=1-2u$ because $CF=1$ and $CB=AF=u$.  For the resulting dodecagon to be regular, we must have $AB=2\cdot BD$.  We find \begin{align*}
1-2u&=u\sqrt{3} \implies \\
1&=2u+u\sqrt{3} \implies \\
1&=u(2+\sqrt{3}) \implies \\
\frac{1}{2+\sqrt{3}}&=u.
\end{align*} Multiplying numerator and denominator by $2-\sqrt{3}$ to rationalize the denominator, we get $u=2-\sqrt{3}$.  The area of a regular hexagon with side length $s$ is $3s^2\sqrt{3}/2$ so the area of the hexagon is $3\sqrt{3}/2$.  The removed area is $6\times \frac{1}{2}(CD)(2\cdot BD)=3u^2\sqrt{3}/2$.  Therefore, the fraction of area removed is $u^2$, which to the nearest tenth of a percent is $0.072=\boxed{7.2\%}$. [asy]
size(250);
real r = sqrt(6-3*sqrt(3));
pair A=r*dir(15), B=r*dir(45), C=dir(60), D=sqrt(3)/2*dir(60), Ep=(0,0), F=dir(0);
pair[] dots = {A,B,C,D,Ep,F};
dot(dots);
label("$A$",A,A);
label("$B$",B,B);
label("$C$",C,C);
label("$D$",D,1.6*(W+0.3*SW));
label("$E$",Ep,SW);
label("$F$",F,E);
int i;
for(i=0;i<=5;++i)

{

draw(dir(60*i)--dir(60*(i+1)));

}
for(i=0;i<=11;++i)

{

draw(r*dir(15+30*i)--r*dir(15+30*(i+1)));

}

draw((0,0)--dir(60));
label("$u$",dir(60)+0.12*SE);
label("$1-2u$",dir(30));[/asy]

