We want to find the radius of the sphere containing the plum and the watermelon, which is $OP + 2 = OW - 8$.  By the Triangle Inequality on triangle $OPW$,
\[OP + PW < OW,\]so $OP < OW - PW = 2$.  This tells us that as long as the sphere is not too tight around the plum, the plum will not touch the glass sphere.

By the Triangle Inequality on triangle $OWP$,
\[OW + WP < OP,\]so $OW < OP - PW = -4$.  This tells us that the sphere is not tight enough around the watermelon.  This makes sense, because when the sphere is tightened around the watermelon, the plum will be inside the watermelon!

We want the sphere to be tight around the plum and the watermelon, so we want the sphere to be equidistant from $P$ and $W$.  In this case, the radius $R$ of the sphere containing the plum and the watermelon satisfies
\[R - 2 = 2 (R - 10).\]Solving for $R$, we find $R = 18/3 = 6$.  Then the volume of the region not contained with the plum or the watermelon is
\[\frac{4}{3} \pi R^3 - \frac{4}{3} \pi \cdot 8^3 - \frac{4}{3} \pi \cdot 2^3 = \frac{4}{3} \pi (6^3 - 8^3 - 2^3) = \boxed{168} \pi.\]

