First, we graph the system of inequalities. The four inequalities represent the following half-planes:

1) $2x + y \le 4 \Rightarrow y \le -2x + 4$: This is the region below the line $y = -2x + 4$.
2) $x + y \ge 1 \Rightarrow y \ge -x + 1$: This is the region above the line $y = -x + 1$.
3) $x \ge 0$: This is the region to the right of the $y$-axis.
4) $y \ge 0$: This is the region above the $x$-axis.

Plotting these half-planes, we get the following graph:

