Taking $ABC$ to be the base of pyramid $ABCH$, the height is $HD$.  Therefore, the volume of pyramid $ABCH$ is $$\frac{[ABC](HD)}{3}.$$We are given that this volume equals 20, so we have \[{[ABC]\cdot HD}=60.\]The volume of prism $ABCDEFGH$ is the product of area of $ABCD$ and the height of the prism, which equals $HD$.   The area of $ABC$ is half the area of rectangle $ABCD$, so we have  \begin{align*}
\text{Volume of }ABCDEFGH &= ([ABCD])(HD) \\
&= 2([ABC])(HD) \\
&= \boxed{120}.\end{align*}

We have the equation $\frac{2x-1}{2x+2}=\frac{x-3}{x-1}$. Cross-multiplying and simplifying, we get \begin{align*}
(2x-1)(x-1)&=(2x+2)(x-3)\\
2x^2 - x - 2x + 1 &= 2x^2 + 2x - 3 \cdot 2x - 3 \cdot 2 \\
2x^2 - 3x + 1&=2x^2-4x-6\\
x&=\boxed{-7}
\end{align*}

We can write the equation as $z^{12} = 2^6,$ so the solutions are of the form
\[z = \sqrt{2} \operatorname{cis} \frac{2 \pi k}{12},\]where $0 \le k \le 11.$  These solutions are equally spaced on the circle with radius $\sqrt{2}.$

[asy]
unitsize(1.5 cm);

int i;

draw(Circle((0,0),sqrt(2)));
draw((-2,0)--(2,0));
draw((0,-2)--(0,2));

for (i = 0; i <= 11; ++i) {
  dot(sqrt(2)*dir(30*i));
}

label("$\sqrt{2}$", (sqrt(2)/2,0), S);
[/asy]

Noting that the imaginary parts cancel due to symmetry, the sum of the solutions with positive real part is then
\begin{align*}
&\sqrt{2} \operatorname{cis} \left( -\frac{\pi}{3} \right) + \sqrt{2} \operatorname{cis} \left( -\frac{\pi}{6} \right) + \sqrt{2} \operatorname{cis} 0 + \sqrt{2} \operatorname{cis} \frac{\pi}{6} + \sqrt{2} \operatorname{cis} \frac{\pi}{3} \\
&= \sqrt{2} \cos \frac{\pi}{3} + \sqrt{2} \cos \frac{\pi}{6} + \sqrt{2} \cos 0 + \sqrt{2} \cos \frac{\pi}{6} + \sqrt{2} \cos \frac{\pi}{3} \\
&= \boxed{2 \sqrt{2} + \sqrt{6}}.
\end{align*}

We compute
\begin{align*}
&\begin{pmatrix} 3a^2 - 3 & 3a \\ 2a^2 - a - 2 & 2a - 1 \end{pmatrix} \begin{pmatrix} -1 & -3a - 2 \\ a & 3a^2 + 2a - 3 \end{pmatrix} \\
&= \begin{pmatrix} (3a^2 - 1)(-1) + (3a)(a) & (3a^2 - 3)(-3a - 2) + (3a)(3a^2 + 2a - 3) \\ (2a^2 - a - 2)(-1) + (2a - 1)(a) & (2a^2 - a - 2)(-3a - 2) + (2a - 1)(3a^2 + 2a - 3) \end{pmatrix} \\
&= \boxed{\begin{pmatrix} 3 & 6 \\ 2 & 7 \end{pmatrix}}.
\end{align*}

