label("$30^\circ$", (9.0,0.7));
[/asy]

Thus, given $\overrightarrow{A} = \begin{pmatrix} -4 \\ 5 \\ -17 \\ \end{pmatrix},$ then $\overrightarrow{P} - \overrightarrow{A} = \begin{pmatrix} 68 \\ 10 \\ 10 \\ \end{pmatrix} x,$ where $0 \le x \le 1.$  So,
\begin{align*}
P_x &= -4 + 68x, \\
P_y &= 5 + 10x, \\
P_z &= -17 + 10x.
\end{align*}As $x$ varies from 0 to 1, $P_x$ varies over all real numbers, so the total length of the curve in both directions is unbounded.  However, we can also obtain solutions by reflecting triangle $ABP$ so that $\angle P = 240^\circ.$

[asy]
