\[PR^2 = PF^2 + FR^2.\]Finally, by the Law of Cosines on $\triangle FRQ,$
\[RQ^2 = FR^2 + FQ^2 - 2 \cdot FR \cdot FQ \cos \angle FRQ.\]Since $\angle FRQ = 90^\circ,$ this becomes
\[RQ^2 = FR^2 + FQ^2.\]Note that $PR = PQ + QR.$  Substituting the appropriate expressions, we get
\[PF^2 + FR^2 = PQ^2 = PF^2 + FQ^2 - FP^2.\]Solving for $FP^2,$ we find that
\[FP^2 = \frac{1}{2} (FR^2 - FQ^2).\]We can eliminate $FP^2$ from the equation $PQ^2 = PF^2 + FQ^2.$  This gives us
